INSERT INTO `master_diagnostic_test_params` VALUES (1,1,'Albumin/Globulin ratio',NULL,NULL,1,1,NULL,NULL,'1512792040000','1512792150000',1),(2,1,'Bilirubin',NULL,NULL,1,1,NULL,NULL,'1512792150000','1512792150000',1),(3,2,'Alkaline phosphatase',NULL,NULL,3,1,NULL,NULL,'1513966678000','1513966678000',1),(4,2,'AST (aspartate aminotransferase)',NULL,NULL,3,1,NULL,NULL,'1513966901000','1513966901000',1),(5,2,'Fasting glucose (blood sugar)','Blood sugar levels can be affected by food or beverages you have ingested recently, your current stress levels, medications you may be taking, and the time of day. The fasting blood sugar test is done after at least 6 hours without food or drink other than water.','70 to 99 mg/dL for the average adult (the elderly tend to score higher even when they are healthy)',7,3,'a,b,c,d',NULL,'1514012212000','1514012212000',1),(6,2,'A/G ratio (albumin/globulin ratio) or total protein test','There are two types of protein your blood — albumin (see above) and globulin. The A/G ratio test compares levels of these proteins with one another. Elevated protein levels could indicate a health condition in need of attention.','a bit over 1, favoring albumin',9,2,NULL,NULL,'1514643872000','1514643872000',1);
