INSERT INTO `master_diagnostic_tests` VALUES (1,1,'Sugar Fasting','3 mL Blood','A blood glucose test measures the amount of glucose in your blood. Glucose, a type of simple sugar, is your body’s main source of energy. Your body converts the carbohydrates you eat into glucose.','1512809012568','1512809012568',1),(2,1,'Gall Stone Analysis','Stone in Screw capped container','Gall Strones are formed due to underluing conditions causing hypercholersterolemia, chinic hemolutic disease and due to complications like cholecystitis. Gall stoner are more common in women over the age of 40 years.','1514641479347','1514641479347',1);
